const Service = () => {
  return (
    <>
      <h1 className="text-center py-4">Our Services</h1>
      <div className="container-fluid">
        <div className="row gy-4">
          <div className="col-md-4"></div>
          <div className="col-md-4"></div>
          <div className="col-md-4"></div>
          <div className="col-md-4"></div>
          <div className="col-md-4"></div>
          <div className="col-md-4"></div>
        </div>
      </div>
    </>
  );
};

export default Service;
